import './index.css'

const Dice = () => {
    const [roll, setRoll] = useState(['1','2','3','4','5','6'])


function randomRoll(){
         console.log(setRoll(Math.random(Math.floor() * 6)))
    }

    return(
        <button value={''} onClick={randomRoll(6)} className='diceDisplay'/>
    )
}

export default Dice;
